import { useEffect } from "react";
import Passwordgnrate from "./Generate";
import { symbsid,lowerid,upperid,numsid } from "./Generate";

const Script=()=>{
    const inpval=document.getElementById("inpval");
    const copybtn=document.getElementById("copybtn");
    const alertbtn=document.getElementById("alert");
    const btnclose=document.getElementById("btnclose");
  
    /*element.addEventListener("focus", rfunc=()=>{
        document.getElementById("rangeval").innerHTML = element.value;
    });
  
    element.addEventListener("mouseup", rfunc2=()=>{
    document.getElementById("rangeval").innerHTML = element.value;
    });
    */
    useEffect(()=>{
        copybtn.addEventListener("click",()=>{
            if(inpval.value==="")
            {
                alert("Something went wrong ,there is no text content!");
            }
            else
            {
                inpval.select();
                document.execCommand("copy");
                alertbtn.classList.add("d-flex");
                alertbtn.style.display="block";
            }
        });
    });
    useEffect(()=>{
        btnclose.addEventListener("click",()=>{
            alertbtn.classList.remove("d-flex");
            alertbtn.style.display="none";
        });
    });
}
const Func1=()=> {
    const loader=document.getElementById("loader");
    const bdyopacity=document.getElementById("bdyopacity");
    if(upperid.checked==false && lowerid.checked==false &&numsid.checked==false &&symbsid.checked==false)
    {
      alert("Please Include the characters");
    }
    else
    {
      bdyopacity.style.opacity="0.6";
      loader.style.display="block";
      setTimeout(<Func2/>,1000);
    }
}
